import React from 'react';
import ProjectSection from '../components/ProjectSection'
import CoraaDescription from '../components/CoraaDescription'
import ProjectEduDescription from '../components/ProjectEduDescription'
import coraaImg from '../assets/speech_recog.png'
import projectedu from '../assets/projectedu.png'
// import "../styles/App.css"

function WorksScreen(){

    return (
        <div>
            <div className="sub-page-title-section">
                <h1>Work experience</h1>
            </div>
            <ProjectSection 
                leftComponent={<CoraaDescription/>} 
                rightComponent={
                    <img src={coraaImg} style={{maxWidth: '100%', maxHeight:'100%'}}/>
                }
                leftPercent={0.55}
            />
            <ProjectSection 
                leftComponent={
                    // <div style={{backgroundColor: 'red'}}>
                    <img src={projectedu} style={{maxWidth: '100%', maxHeight:'100%'}}/>
                    // </div>
                }
                rightComponent={<ProjectEduDescription/>} 
            />
        </div>
    );
}

export default WorksScreen;
